use Moose;
use namespace::autoclean;

extends 'Catalyst::Model';

has 'lists' => (
    is      => 'ro',
    isa     => 'ArrayRef',
    default => sub {
        [
            qw/あなたは結婚できません。
              あなたは不幸に合います。
              あたなは貧乏になります。
              あなたは死にます。
              /
        ];
    },
    auto_deref => 1,
);

sub uranau {
my ($self, $name) = @_;
my @lists = $self->lists;
my $number = $self->get_number( $name, $#lists + 1 );
return encode_utf8( $lists[$number] );
}

sub get_number {
my ($self, $str, $max) = @_;
my $num = 0;
$num += ord( $_ ) for split //, $str;
return $num % $max;
}

